import React from "react";
import "../css/Product.css";

function Product({ image, name, type }) {
  return (
    <div className="product-container section-padding">
      <div className="img-container">
        <img src={image} alt="" />
      </div>
      <div className="product-info">
        <p>{name}</p>
        <p>{type.join(", ")}</p>
      </div>
    </div>
  );
}

export default Product;
